import OverviewPlayerItem from "./OverviewPlayerItem"

type Round = { throw1?: number };
type PlayerProps = {
    name: string;
    score: number;
    round: Round[];
};

type Props = {
    userMap: PlayerProps[];
}

function OverviewPlayerItemList({userMap }: Props) {

    const getRounds = (rounds: Round[]) =>
        rounds[rounds.length - 1].throw1 === undefined
        ? rounds.length - 1
        :rounds.length;

    const getAveragePerRound = (score: number, rounds: Round[]) => {
        const completedRounds = getRounds(rounds);
        return completedRounds === 0 ? 0 : Math.round((301 - score) / completedRounds);
    };

    return (
        <>     
                    <OverviewPlayerItem
                    rounds={getRounds(userMap.rounds)}
                    />
        </>
    )
}
export default OverviewPlayerItemList
